import React from "react";
import { Container } from "./styles/SectionOneStyle";
const SectionOne = () => {
    return (
        <Container>
            <h2>Atualmente</h2>
            <p>
                Hoje faço o curso da Danki Code no pacote FullStack, e no
                momento que este site foi desenvolvido apenas a parte de
                Front-End do curso foi finalizada.
            </p>
        </Container>
    );
};

export default SectionOne;
